<h2 id="react-hook" tabindex="-1"><a class="header-anchor" href="#react-hook" aria-hidden="true">#</a> React Hook</h2>
<blockquote>
<p>Hook \u662F React 16.8.0 \u589E\u52A0\u7684\u65B0\u7279\u6027\uFF0C\u8BA9\u6211\u4EEC\u80FD\u5728\u51FD\u6570\u5F0F\u7EC4\u4EF6\u4E2D\u4F7F\u7528 <code v-pre>state</code> \u548C\u5176\u4ED6\u7279\u6027</p>
